import Link from 'next/link';

const HamburgerToggle = props => (
    <button className="toggle-button">
        <div className="button-line"></div>
        <div className="button-line"></div>
        <div className="button-line"></div>
        <style jsx>{`
        .toggle-button {
            display: flex;
            flex-direction: column;
            background: transparent;
            margin-left: 0.5rem;
            padding: 2rem;  
            border: none;      
        }

        .toggle-button:focus {
            outline:none;
        }

        .button-line {
            width: 30px;
            height: 1px:
            background: white;
        }
    `} </style>
    </button>
    
);

export default HamburgerToggle;
